import React from "react";
import ProductCard from "./ProductCard";

export default function ProductGrid({ selectedCategory, sortOrder, onSelectProduct, onAddToCart }) {
  const products = [
   { title: "Strawberries", subtitle: "Fresh pack", category: "Fruits", price: 10, image: "data:image/jpeg;base64," },
   { title: "Bananas", subtitle: "1kg", category: "Fruits", price: 6, image: "data:image/jpeg;base64," },
   { title: "Tomatoes", subtitle: "Organic", category: "Vegetables", price: 7, image: "data:image/jpeg;base64," },
   { title: "Coca Cola", subtitle: "1.5L Bottle", category: "Drinks", price: 12, image: "data:image/jpeg;base64," },
  ];

  const filtered = selectedCategory === "All"
    ? products
    : products.filter(p => p.category === selectedCategory);

  const sorted = [...filtered].sort((a, b) =>
    sortOrder === "ASC" ? a.price - b.price : b.price - a.price
  );

  return (
    <div className="grid">
      {sorted.map((p, i) => (
        <ProductCard
          key={i}
          {...p}
          onSelect={() => onSelectProduct(p)}
          onAdd={() => onAddToCart(p)}
        />
      ))}
    </div>
  );
}
